  const popular = useSelector((state) => state.trending.data.results);
  const loading = useSelector((state) => state.trending.loading);

  useEffect(() => {
    props.fetchLatest();
  }, []);

  return loading === true ? (
    <h1>...loading</h1>
  ) : (
